byte mt[3][3] = {
  {2,3,4},         //motor0右
  {6,7,8}         //motor1左
};



void setup() {

  Serial.begin(9600);
  pinMode(mt[0][0],OUTPUT);
  pinMode(mt[0][1],OUTPUT);
  pinMode(mt[0][2],OUTPUT);
  pinMode(mt[1][0],OUTPUT);
  pinMode(mt[1][1],OUTPUT);
  pinMode(mt[1][2],OUTPUT);

  r_val=(b_val+w_val)/2;  //基準の値を設定

  //テスト走行

//  digitalWrite(mt[1][0],LOW);   //モータは方向固定
//  digitalWrite(mt[1][1],HIGH);
//  analogWrite(mt[1][2],50);
//  delay(1000);
  digitalWrite(mt[0][0],LOW);
  digitalWrite(mt[0][1],HIGH);
  analogWrite(mt[0][2],50);
  delay(1000);
}

void loop() {
  val[0]=analogRead(v[0]);
  val[1]=analogRead(v[1]);
  val_diff[0]=val[0]-r_val;  //ズレの大きさ
  val_diff[1]=val[1]-r_val;

  digitalWrite(mt[1][0],LOW);   //モータは方向固定
  digitalWrite(mt[1][1],HIGH);
  digitalWrite(mt[0][0],LOW);
  digitalWrite(mt[0][1],HIGH);



  p_val[0]=abs(val_diff[0])*kp;//P値の計算
  p_val[1]=abs(val_diff[1])*kp;

  i_val[0]=abs(val[0]-pre_val[0])*(100/(b_val-w_val))*ki;//I値の計算
  i_val[1]=abs(val[1]-pre_val[1])*(100/(b_val-w_val))*ki;

  d_val[0]=abs(val_diff[0]-pre_diff[0])*(100/(b_val-w_val))*kd;//D値の計算
  d_val[1]=abs(val_diff[1]-pre_diff[1])*(100/(b_val-w_val))*kd;

  if(val[0]>900){
    pos=false; //左のセンサが黒なら右にいると記憶
  }else{
    pos=true;  //右のセンサが黒なら左にいると記憶
  }

  int def_val=250;
  if(pos==false){  //右にいるなら右を強くして戻す
      analogWrite(mt[0][2],def_val);  //PWM制御//右モータ
      analogWrite(mt[1][2],def_val-(p_val[0]+i_val[0]+d_val[0]));                               //左モータ
  }else{  //左にいるなら左を強くして戻す
      analogWrite(mt[0][2],def_val-(p_val[1]+i_val[1]+d_val[1]));                               //PWM制御//右モータ
      analogWrite(mt[1][2],def_val);  //左モータ
  }





  pre_diff[0]=val_diff[0];   //一個前の差分の更新
  pre_diff[1]=val_diff[1];

  pre_val[0]=val[0];    //一個前の明るさの更新
  pre_val[1]=val[1];

  Serial.print(“センサ値:“);
  Serial.print(val[0]);//左
  Serial.print(“|”);
  Serial.print(val[1]);//右
  Serial.print(” P値:“);
  Serial.print(“|”);
  Serial.print(p_val[0]);
  Serial.print(“|”);
  Serial.print(p_val[1]);
  Serial.print(” I値:“);
  Serial.print(i_val[0]);//左
  Serial.print(“|”);
  Serial.print(i_val[1]);//右
  Serial.print(” D値:“);
  Serial.print(d_val[0]);//左
  Serial.print(“|”);
  Serial.print(d_val[1]);//右
  Serial.print(“||“);
  if(pos==false){
    Serial.println(“right”);
  }else{
    Serial.println(“left”);
  }

}

